import React, { useState, useEffect } from 'react';

const Lectures = () => {
  const [lectures, setLectures] = useState([]);
  const [name, setName] = useState('');
  const [modules, setModules] = useState('');
  const [phone, setPhone] = useState('');
  const [picture, setPicture] = useState(null);
  const [imagePreview, setImagePreview] = useState('');

  // Load existing lectures from users table
  useEffect(() => {
    fetchLecturers();
  }, []);

  const fetchLecturers = async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await fetch('/api/lecturers', {
        headers: { Authorization: `Bearer ${token}` }
      });
      const data = await res.json();
      setLectures(data); // data should be array of users with role 'lecturer'
    } catch (err) {
      console.error('Failed to fetch lecturers:', err);
    }
  };

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    setPicture(file);
    const reader = new FileReader();
    reader.onloadend = () => {
      setImagePreview(reader.result);
    };
    if (file) {
      reader.readAsDataURL(file);
    }
  };

  const handleAddLecture = () => {
    if (!name || !modules || !phone || !picture) {
      alert('Please fill all fields and select an image.');
      return;
    }

    const newLecture = {
      id: Date.now(),
      name,
      modules: modules.split(',').map(m => m.trim()),
      phone,
      picture: imagePreview,
    };

    setLectures([...lectures, newLecture]);

    // Reset form
    setName('');
    setModules('');
    setPhone('');
    setPicture(null);
    setImagePreview('');
  };

  return (
    <div>
      <h3>Lectures</h3>
      {/* Button to refresh data from server */}
      <button onClick={fetchLecturers}>Refresh Lecturers</button>

      {/* Table of fetched users as lectures */}
      <table className="table table-striped">
        <thead>
          <tr>
            <th>ID</th>
            <th>Username</th>
            <th>Faculty</th>
          </tr>
        </thead>
        <tbody>
          {lectures.map((lecture) => (
            <tr key={lecture.id}>
              <td>{lecture.id}</td>
              <td>{lecture.username}</td>
              <td>{lecture.faculty}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Add new lecture form remains unchanged */}
      <h4>Add New Lecture</h4>
      <div className="mb-3">
        <label>Name:</label>
        <input
          type="text"
          className="form-control"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </div>
      <div className="mb-3">
        <label>Modules (comma separated):</label>
        <input
          type="text"
          className="form-control"
          value={modules}
          onChange={(e) => setModules(e.target.value)}
        />
      </div>
      <div className="mb-3">
        <label>Phone Number:</label>
        <input
          type="text"
          className="form-control"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
        />
      </div>
      <div className="mb-3">
        <label>Picture:</label>
        <input
          type="file"
          accept="image/*"
          className="form-control"
          onChange={handleImageChange}
        />
        {imagePreview && (
          <img
            src={imagePreview}
            alt="Preview"
            style={{ width: '100px', marginTop: '10px' }}
          />
        )}
      </div>
      <button className="btn btn-primary" onClick={handleAddLecture}>Add Lecture</button>
    </div>
  );
};

export default Lectures;
